import * as api from "../Api/helperApis.js";
export function addTeamToAlliance(team, alliance) {
  api.addTeamToAllianceApi(team, alliance);
  console.log(localStorage.getItem(`${alliance.id}`), '');
  localStorage.setItem(
    `${alliance.id}`,
    JSON.parse(localStorage.getItem(`${alliance.id}`).concat(team))
  );

  console.log(`${team["Name"]} added to alliance`);
}
